import './mailtemplate.css';
function MailTemplate() {
    return (
    <div className="template">
        <div className="templateName">
           Template Name
        </div>
        <div className="templateBody">
           Template Buttons
        </div>
        <div className="templateButtons">
           Template body
        </div>
    </div>
    );
  }

export default MailTemplate ;
